import{_ as e,o as t,c as n,e as a}from"./app-3ee0fe23.js";const s={},o=a(`<h1 id="faq" tabindex="-1"><a class="header-anchor" href="#faq" aria-hidden="true">#</a> FAQ</h1><h3 id="could-not-find-an-open-unreal-editor-instance" tabindex="-1"><a class="header-anchor" href="#could-not-find-an-open-unreal-editor-instance" aria-hidden="true">#</a> Could not find an open Unreal Editor instance!</h3><p>Toggle <code>remote execution</code> off and back on in your project settings.</p><p>Make sure the Multicast Bind Address in the unreal project is set to <code>127.0.0.1</code>.</p><p>Go through the quickstart again. If that doesn&#39;t work the issue is most likely due to a networking issue. Check your systems firewall for blender and python. Also check the ports <code>6766</code> and <code>9998</code> on your computer to see if they are blocked by another application.</p><p>Before you start the Unreal Editor, run these commands from a PowerShell prompt:</p><div class="language-commandline line-numbers-mode" data-ext="commandline"><pre class="language-commandline"><code>    netstat -an|sls 6766
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>Then start your project (that has Remote Execution enabled with the multicast group endpoint presumably set to 239.0.0.1:6766) and run these commands again.</p><p>The first time, you run <code>netstat</code>, nothing should show up. The second time you run it, you should see this:</p><div class="language-commandline line-numbers-mode" data-ext="commandline"><pre class="language-commandline"><code>   UDP    0.0.0.0:6766           *:*
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="can-i-have-multiple-unreal-editors-open-at-once-and-use-send-to-unreal" tabindex="-1"><a class="header-anchor" href="#can-i-have-multiple-unreal-editors-open-at-once-and-use-send-to-unreal" aria-hidden="true">#</a> Can I have multiple Unreal editors open at once and use Send to Unreal?</h3><p>Currently, no. Send to Unreal connects to the first Unreal editor process on your OS. So there isn&#39;t a good way of specifying which Unreal editor instance to connect to at the moment. There are plans to support this is the future though.</p><h3 id="are-my-settings-saved" tabindex="-1"><a class="header-anchor" href="#are-my-settings-saved" aria-hidden="true">#</a> Are my settings saved?</h3><p>Yes, the state of the tool&#39;s properties get tracked in each blend file and saved along with the rest of the blend file scene data.</p><h3 id="why-are-my-settings-back-to-their-defaults" tabindex="-1"><a class="header-anchor" href="#why-are-my-settings-back-to-their-defaults" aria-hidden="true">#</a> Why are my settings back to their defaults?</h3><p>If you open a new blend file that does not already contain Send to Unreal properties, then the settings are just the defaults. If you load a saved file, the settings will be the values they were saved at.</p><h3 id="why-isn-t-it-finding-my-x-skeleton-physics-asset" tabindex="-1"><a class="header-anchor" href="#why-isn-t-it-finding-my-x-skeleton-physics-asset" aria-hidden="true">#</a> Why isn&#39;t it finding my X (skeleton, physics asset, ...)?</h3><p>For setting the skeleton and physics asset in the Path setting, make sure the game isn&#39;t running in PIE. For doing anything with the addon make sure not to have PIE running.</p>`,18),i=[o];function r(d,h){return t(),n("div",null,i)}const c=e(s,[["render",r],["__file","faq.html.vue"]]);export{c as default};
